import { BrowserRouter as Router, Routes, Route, Navigate, Link } from 'react-router-dom';
import { useState } from 'react';
import { SunIcon, MoonIcon, LogoutIcon } from '@heroicons/react/24/outline';
import Login from './pages/Login';
import Chat from './pages/Chat';
import History from './pages/History';
import Analytics from './pages/Analytics';

function App() {
    const [isAuthenticated, setIsAuthenticated] = useState(!!localStorage.getItem('token'));
    const [isDarkMode, setIsDarkMode] = useState(false);

    const toggleDarkMode = () => {
        setIsDarkMode(!isDarkMode);
        document.documentElement.classList.toggle('dark');
    };

    return ( <
            Router >
            <
            div className = "min-h-screen" > {
                isAuthenticated && ( <
                    div className = "flex" > { /* Sidebar */ } <
                    div className = "w-64 bg-white dark:bg-gray-900 h-screen p-6 shadow-lg" >
                    <
                    h1 className = "text-2xl font-bold mb-8 text-gray-900 dark:text-white" > Creator Platform < /h1> <
                    nav className = "space-y-2" >
                    <
                    Link to = "/chat"
                    className = "chatgpt-sidebar-item flex items-center space-x-2" >
                    <
                    svg className = "w-5 h-5"
                    fill = "none"
                    stroke = "currentColor"
                    viewBox = "0 0 24 24" > < path strokeLinecap = "round"
                    strokeLinejoin = "round"
                    strokeWidth = { 2 }
                    d = "M8 10h.01M12 10h.01M16 10h.01M9 16H5v-4a2 2 0 012-2h10a2 2 0 012 2v4h-4M12 16h.01" / > < /svg> <
                    span > New Chat < /span> <
                    /Link> <
                    Link to = "/history"
                    className = "chatgpt-sidebar-item flex items-center space-x-2" >
                    <
                    svg className = "w-5 h-5"
                    fill = "none"
                    stroke = "currentColor"
                    viewBox = "0 0 24 24" > < path strokeLinecap = "round"
                    strokeLinejoin = "round"
                    strokeWidth = { 2 }
                    d = "M9 12h6m-6 4h6m2 5H7a2 2 0 01-2-2V5a2 2 0 012-2h5.586a1 1 0 01.707.293l5.414 5.414a1 1 0 01.293.707V19a2 2 0 01-2 2z" / > < /svg> <
                    span > Content History < /span> <
                    /Link> <
                    Link to = "/analytics"
                    className = "chatgpt-sidebar-item flex items-center space-x-2" >
                    <
                    svg className = "w-5 h-5"
                    fill = "none"
                    stroke = "currentColor"
                    viewBox = "0 0 24 24" > < path strokeLinecap = "round"
                    strokeLinejoin = "round"
                    strokeWidth = { 2 }
                    d = "M16 8v8m-4-5v5m-4-2v2m-2 4h12a2 2 0 002-2V6a2 2 0 00-2-2H6a2 2 0 00-2 2v12a2 2 0 002 2z" / > < /svg> <
                    span > Analytics < /span> <
                    /Link> <
                    button onClick = {
                        () => {
                            localStorage.removeItem('token');
                            setIsAuthenticated(false);
                        }
                    }
                    className = "chatgpt-sidebar-item flex items-center space-x-2 text-red-600 dark:text-red-400" >
                    <
                    LogoutIcon className = "w-5 h-5" / >
                    <
                    span > Logout < /span> <
                    /button> <
                    /nav> <
                    button onClick = { toggleDarkMode }
                    className = "mt-6 flex items-center space-x-2 text-gray-900 dark:text-white chatgpt-sidebar-item" >
                    { isDarkMode ? < SunIcon className = "w-5 h-5" / > : < MoonIcon className = "w-5 h-5" / > } <
                    span > { isDarkMode ? 'Light Mode' : 'Dark Mode' } < /span> <
                    /button> <
                    /div> { /* Main Content */ } <
                    div className = "flex-1 p-8" >
                    <
                    Routes >
                    <
                    Route path = "/login"
                    element = { < Login setIsAuthenticated = { setIsAuthenticated }
                        />} / >
                        <
                        Route
                        path = "/chat"
                        element = { isAuthenticated ? < Chat / > : < Navigate to = "/login" / > }
                        /> <
                        Route
                        path = "/history"
                        element = { isAuthenticated ? < History / > : < Navigate to = "/login" / > }
                        /> <
                        Route
                        path = "/analytics"
                        element = { isAuthenticated ? < Analytics / > : < Navigate to = "/login" / > }
                        /> <
                        Route path = "/"
                        element = { < Navigate to = "/login" / > }
                        /> <
                        /Routes> <
                        /div> <
                        /div>
                    )
                } {
                    !isAuthenticated && ( <
                            Routes >
                            <
                            Route path = "/login"
                            element = { < Login setIsAuthenticated = { setIsAuthenticated }
                                />} / >
                                <
                                Route path = "*"
                                element = { < Navigate to = "/login" / > }
                                /> <
                                /Routes>
                            )
                        } <
                        /div> <
                        /Router>
                );
            }

            export default App;
